import React from 'react';

function Expenses() {
	const ExpenseData = [
		{
			item: 'Toilet Papper',
			cost: '99',
			date: new Date(2020, 7, 14),
		},
	];
	return (
		<div>
			<h1>{ExpenseData[0].cost}</h1>
		</div>
	);
}

export default Expenses;
